import React from 'react'

export class Home extends React.Component {
    render() {
        return (
            <div className="container2">
                <div className="container1">
                    <h1>Welcome to SWAPI-React!</h1>
                    <div className="about">
                    <p>
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris aliquam, ante eget viverra laoreet, dolor mi elementum nibh, at malesuada massa lorem in nisi. Morbi mattis tellus at quam ultrices, efficitur consequat arcu egestas. In et nulla ac turpis facilisis commodo eu convallis lacus. Sed nec odio pulvinar mi pharetra ultrices id sed diam. Vestibulum euismod dui venenatis ante accumsan rhoncus. Nullam et leo et sem mattis mattis. Proin sollicitudin odio eu justo sollicitudin, eget mollis tellus eleifend. Praesent efficitur vulputate lectus, eget commodo ligula porta at. In libero augue, elementum non felis quis, auctor faucibus odio. In porttitor congue mauris, ut consequat turpis tristique non. Etiam sodales hendrerit libero non porttitor. Mauris venenatis semper ipsum ac egestas. Nunc laoreet egestas magna ac luctus. Donec fermentum rutrum massa. Ut porttitor malesuada odio in ultricies. Nam hendrerit venenatis lorem vel ultrices.
                    </p>
                    <p>
                    Aliquam nisl nibh, consequat vitae mauris vitae, egestas semper urna. Mauris mauris orci, scelerisque a luctus at, hendrerit ut enim. Ut finibus, est eget venenatis aliquam, eros turpis gravida mauris, et venenatis augue odio ut dolor. Praesent id congue neque, vitae lacinia sapien. Mauris at elit erat. Nullam commodo lorem vel risus ullamcorper vestibulum. Aenean vel tempus ante. Cras ornare lobortis finibus. Donec hendrerit scelerisque felis, quis euismod turpis congue in. Maecenas vitae leo at urna egestas lobortis at sit amet mauris. Vivamus sodales, lectus a ullamcorper feugiat, urna dolor vulputate sapien, eu varius risus mauris eu massa. Nam in eros eu erat laoreet facilisis. Maecenas fermentum lacus enim. Nulla faucibus quis nulla congue condimentum.
                    </p>
                    <p>

                    </p>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
